import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Home.css";

const Home = ({ user }) => {
    const navigate = useNavigate();
    const [currentUser, setCurrentUser] = useState(user);

    useEffect(() => {
        if (!user) {
            const storedUser = JSON.parse(localStorage.getItem("user"));
            if (!storedUser) {
                navigate("/login");
            } else {
                setCurrentUser(storedUser);
            }
        }
    }, [user, navigate]);

    if (!currentUser) {
        return <p>Đang tải...</p>;
    }

    return (
        <div className="home-container">
            {/* Navbar */}
            <nav className="navbar">
                <h1>Trung Tâm Gia Sư</h1>
                <div className="navbar-buttons">
                    {window.location.pathname !== "/" && <span>🏠 Trang chủ</span>}
                    <span>🔔 Thông báo</span>
                    <span>⚙️ Cài đặt</span>
                    <span>🚪 Đăng xuất</span>
                </div>
            </nav>


            <div className="main-content">
                {/* Sidebar */}
                <aside className="sidebar">
                    <ul>
                        <li>🏠 Trang chủ</li>
                        {currentUser.role === "hv" && (
                            <>
                                <li>📖 Lịch học</li>
                                <li>📊 Điểm số</li>
                                <li>💰 Học phí</li>
                                <li>🔄 Học bù</li>
                            </>
                        )}
                        {currentUser.role === "gv" && (
                            <>
                                <li>📚 Lịch giảng dạy</li>
                                <li>📝 Chấm điểm học sinh</li>
                                <li>⏳ Chấm công</li>
                            </>
                        )}
                        {currentUser.role === "cm" && (
                            <>
                                <li>📖 Quản lý nhóm học</li>
                                <li>📊 Báo cáo tài chính</li>
                                <li>🗓️ Thời khóa biểu chung</li>
                                <li>📋 Xem báo cáo học sinh & giáo viên</li>
                            </>
                        )}
                        {currentUser.role === "ad" && (
                            <>
                                <li>⚙️ Quản lý hệ thống</li>
                                <li>📊 Doanh thu & lương</li>
                                <li>📑 Báo cáo chuyên cần</li>
                            </>
                        )}
                    </ul>
                </aside>

                {/* Nội dung Dashboard */}
                <main className="dashboard">
                    <h2>Bảng điều khiển</h2>
                    {currentUser.role === "hv" && (
                        <div>
                            <p>📌 Bạn có thể xem lịch học, điểm số và học phí tại đây.</p>
                        </div>
                    )}
                    {currentUser.role === "gv" && (
                        <div>
                            <p>📌 Bạn có thể xem lịch giảng dạy, nhập điểm và chấm công.</p>
                        </div>
                    )}
                    {currentUser.role === "cm" && (
                        <div>
                            <p>📌 Quản lý nhóm học, xem báo cáo tài chính và điều chỉnh thời khóa biểu.</p>
                        </div>
                    )}
                    {currentUser.role === "ad" && (
                        <div>
                            <p>📌 Quản lý hệ thống, lập báo cáo doanh thu & lương, theo dõi điểm danh.</p>
                        </div>
                    )}
                </main>
            </div>
        </div>
    );
};

export default Home;
